import React from 'react';
import { Container, Typography, Box, Grid, Paper } from '@mui/material';
import { styled } from '@mui/material/styles';

// Styled components
const ServiceCategory = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(3),
  textAlign: 'left',
  width: '100%',
  // Remove minHeight to allow content to dictate the height
  // Ensure consistent box-sizing
  boxSizing: 'border-box',
}));

const GridItem = styled(Grid)(({ theme }) => ({
  display: 'flex',
  justifyContent: 'center',
  // Ensure each grid item takes up equal space
  flexBasis: 'calc(20% - 16px)', // Adjust spacing
  maxWidth: 'calc(20% - 16px)', // Adjust spacing
}));

const SpaPricePage = () => {
  return (
    <Container className="container">
      <Box mt={4} mb={4}>
        <Typography variant="h2" align="center">Spa Services</Typography>

        {/* Services Price Chart */}
        <Grid container spacing={4} mt={4}>
          <Grid item xs={12} sm={6} md={4} component={GridItem}>
            <ServiceCategory elevation={3}>
              <Typography variant="h5" align="center" gutterBottom>
                Body Massages
              </Typography>
              <Box p={4} textAlign="left">
                <Typography variant="body1">Swedish Massage - 30•60•90•120min / $50•$80•$120•$150</Typography>
                <Typography variant="body1">Swedish Massage - $50</Typography>
                <Typography variant="body1">Swedish Massage - $50</Typography>
              </Box>
            </ServiceCategory>
          </Grid>

          {/* Add more items here as needed */}
          <Grid item xs={12} sm={6} md={4} component={GridItem}>
            <ServiceCategory elevation={3}>
              <Typography variant="h5" align="center" gutterBottom>
                Deep Tissue Spa
              </Typography>
              <Box p={4} textAlign="left">
                <Typography variant="body1">Deep Tissue Massage - $90</Typography>
                <Typography variant="body1">Anti-Stress Treatment - $100</Typography>
                <Typography variant="body1">Sports Massage - $85</Typography>
              </Box>
            </ServiceCategory>
          </Grid>

          {/* Additional Service Categories */}
        </Grid>
      </Box>
    </Container>
  );
};

export default SpaPricePage;
